import React from 'react';
import { connect } from 'react-redux';
import todoListContainer from '../containers/todosList.container';
import { isBoolean } from 'util';

const TodosTable = ({todoList}) => {
    if (todoList.length) {
        console.log(todoList[1].todoCompleted);
    }

    return (
        <table className='table table-hover'>
                <thead>
                    <tr>
                        <th>Description</th>
                        <th>Responsible</th>
                        <th>Priority</th>
                        <th>Completed</th>
                        <th>Actions</th>
                    </tr>
                </thead>
                <tbody>
                    {todoList.map(todo => {
                        return (
                            <tr key={todo._id}>
                                <td>{todo.todoDescription}</td>
                                <td>{todo.todoResponsible}</td>
                                <td>{todo.todoPriority}</td>
                                <td>{isBoolean(todo.todoCompleted)}</td>
                            </tr>
                        )
                        })
                    }
                </tbody>
            </table>
    )
}

export default connect(todoListContainer.mapStateToProps)(TodosTable);
